import React, { useState, useEffect } from "react";
import axios from "axios";
import "./Profile.css";
import Cell from "../Buttons/Cell";
import {
    createColumnHelper,
    flexRender,
    getCoreRowModel,
    useReactTable,
} from "@tanstack/react-table";




const defaultData = [
    axios.get("http://localhost:8080/api/profile" , {withCredentials:true}).then((response) => {
        if (response.data && response.data.userCompanies) {
            return response.data.userCompanies;
        }
    }).catch((error) => {
        console.log(error);
    }),
];

const columnHelper = createColumnHelper();

const columns = [
    columnHelper.accessor("company_name", {
        header: "Company Name",
    }),
    columnHelper.accessor("status", {
        header: "Status",
    }),
    columnHelper.accessor("next_deadline", {
        header: "Next Deadline",
    }),
    columnHelper.accessor("links", {
        header: "Links",
    }),
];

const Profile = () => {
    const [data, setData] = useState(...defaultData);

    const table = useReactTable({
        data,
        columns,
        getCoreRowModel: getCoreRowModel(),
    });

    console.log(table);

    return (
        <table>
            <thead>
            {table.getHeaderGroups().map((headerGroup) => (
                <tr key={headerGroup.id}>
                {headerGroup.headers.map((header) => (
                    <th key={header.id}>
                    {header.isPlaceholder
                        ? null
                        : flexRender(
                            header.column.columnDef.header,
                            header.getContext()
                        )}
                    </th>
                ))}
                </tr>
            ))}
            </thead>
            <tbody>
            {table.getRowModel().rows.map((row) => (
                console.log(row),
                <tr key={row.id}>
                {row.getVisibleCells().map((cell) => (
                    <td key={cell.id}>
                    {flexRender(cell.column.columnDef.cell, cell.getContext())}
                    </td>
                ))}
                </tr>
            ))}
            </tbody>
        </table>
    );
}

export default Profile;
